import React from 'react'
import { Form, Input, Divider, Message } from 'semantic-ui-react'
import iunnologo from './iunnologo.png'

export default class Header extends React.Component {

    render() {

        return (
            <Form success onSubmit={this.addQty()} size='massive'>
                    <Form.Field inline>
                        <label>How Many People Are Eating?</label>
                        <Input placeholder='1+' />
                        <Message success header='Got It!' content='3 meals.'/>
                    </Form.Field>
                </Form>

        )
    }

}
